import React, {Fragment, Component} from 'react';
import CSSTransitionGroup from 'react-transition-group/CSSTransitionGroup'

import AppHeader from '../../Layout/AppHeader/';
import AppSidebar from '../../Layout/AppSidebar/';
import AppFooter from '../../Layout/AppFooter/';

// Theme Options

import ThemeOptions from '../../Layout/ThemeOptions/';
import {Button, Card, CardBody, CardImg, CardSubtitle, CardTitle, Col, ListGroup, ListGroupItem, Row} from "reactstrap";
import bg1 from "../../assets/utils/images/dropdown-header/abstract1.jpg";
import avatar1 from "../../assets/utils/images/avatars/1.jpg";
import bg2 from "../../assets/utils/images/dropdown-header/abstract2.jpg";
import avatar2 from "../../assets/utils/images/avatars/2.jpg";
import LiquidFillGauge from "react-liquid-gauge";
import bg3 from "../../assets/utils/images/dropdown-header/abstract3.jpg";
import avatar3 from "../../assets/utils/images/avatars/3.jpg";
import cx from "classnames";
import Footer from "../Components/GuidedTours/Examples/Footer";

const Homepage = () => (
    <Fragment>
        <AppHeader/>
        <div className="app-main">
            <div className="app-main__inner">
                <Row>
                    <Card className="main-card mb-3">
                        <CardImg top width="100%"
                                 src= "../../assets/utils/images/dropdown-header/abstract1.jpg"
                                 alt="Card image cap"/>
                        <CardBody>
                            <CardTitle>Card title</CardTitle>
                            <CardSubtitle>Card subtitle</CardSubtitle>
                            Some quick example text to build on the card title and make up the bulk of
                            the
                            card's content.
                            <Button>Button</Button>
                        </CardBody>
                    </Card>
                    <Card className="main-card mb-3">
                        <CardImg top width="100%"
                                 src={bg1}
                                 alt="Card image cap"/>
                        <CardBody>
                            <CardTitle>Card title</CardTitle>
                            <CardSubtitle>Card subtitle</CardSubtitle>
                            Some quick example text to build on the card title and make up the bulk of
                            the
                            card's content.
                            <Button>Button</Button>
                        </CardBody>
                    </Card>
                    <Card className="main-card mb-3">
                        <CardImg top width="100%"
                                 src={bg1}
                                 alt="Card image cap"/>
                        <CardBody>
                            <CardTitle>Card title</CardTitle>
                            <CardSubtitle>Card subtitle</CardSubtitle>
                            Some quick example text to build on the card title and make up the bulk of
                            the
                            card's content.
                            <Button>Button</Button>
                        </CardBody>
                    </Card>
                    <Card className="main-card mb-3">
                        <CardImg top width="100%"
                                 src={bg1}
                                 alt="Card image cap"/>
                        <CardBody>
                            <CardTitle>Card title</CardTitle>
                            <CardSubtitle>Card subtitle</CardSubtitle>
                            Some quick example text to build on the card title and make up the bulk of
                            the
                            card's content.
                            <Button>Button</Button>
                        </CardBody>
                    </Card>
                </Row>
                <Row>
                    <Col sm="12" lg="6" xl="3">
                        <Card className="mb-3 profile-responsive">
                            <div className="dropdown-menu-header">
                                <div className="dropdown-menu-header-inner bg-dark">
                                    <div className="menu-header-image opacity-10"
                                         style={{
                                             backgroundImage: 'url(' + bg1 + ')'
                                         }}
                                    />
                                    <div className="menu-header-content btn-pane-right">
                                        <div className="avatar-icon-wrapper mr-3 avatar-icon-xl btn-hover-shine">
                                            <div className="avatar-icon rounded">
                                                <img src={avatar1} alt="Avatar 5"/>
                                            </div>
                                        </div>
                                        <div>
                                            <h5 className="menu-header-title">Jeff Walberg</h5>
                                            <h6 className="menu-header-subtitle">Lead UX Developer</h6>
                                        </div>
                                        <div className="menu-header-btn-pane">
                                            <Button color="success">
                                                View Profile
                                            </Button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <ListGroup flush>
                                <ListGroupItem>
                                    <div className="widget-content pt-1 pl-0 pr-0">
                                        <div className="text-center">
                                            <h5 className="widget-heading opacity-4 mb-0">
                                                Month Totals
                                            </h5>
                                            <h6 className="mt-3 mb-3">
                                                    <span className="pr-2">
                                                        <b className="text-danger">12</b> new leads,
                                                    </span>
                                                <span>
                                                        <b className="text-success">$56.24</b> in sales
                                                    </span>
                                            </h6>
                                            <Button color="primary" className="btn-wide btn-pill" outline>Full
                                                Report</Button>
                                        </div>
                                    </div>
                                </ListGroupItem>
                                <ListGroupItem className="p-0">
                                    <div className="grid-menu grid-menu-2col">
                                        <Row className="no-gutters">
                                            <Col sm="6">
                                                <Button
                                                    className="btn-icon-vertical btn-square btn-transition br-bl"
                                                    outline color="link">
                                                    <i className="lnr-license btn-icon-wrapper btn-icon-lg mb-3"> </i>
                                                    View Profile
                                                </Button>
                                            </Col>
                                            <Col sm="6">
                                                <Button
                                                    className="btn-icon-vertical btn-square btn-transition br-br"
                                                    outline color="link">
                                                    <i className="lnr-music-note btn-icon-wrapper btn-icon-lg mb-3"> </i>
                                                    Leads Generated
                                                </Button>
                                            </Col>
                                        </Row>
                                    </div>
                                </ListGroupItem>
                            </ListGroup>
                        </Card>
                    </Col>
                    <Col sm="12" lg="6" xl="3">
                        <Card className="mb-3 profile-responsive">
                            <div className="dropdown-menu-header">
